import React, { useState } from "react";
import { Link } from "react-router-dom"; 

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <nav className="navbar">
      <div className="burger-icon" onClick={toggleMenu}>
        <div className="bar"></div>
        <div className="bar"></div>
        <div className="bar"></div>
      </div>
      <ul className={`navbar-links ${isMenuOpen ? "open" : ""}`}>
        <li><Link to="/" onClick={() => setIsMenuOpen(false)}>الرئيسية</Link></li>
        <li><Link to="/about" onClick={() => setIsMenuOpen(false)}>من نحن</Link></li>
        <li><Link to="/services" onClick={() => setIsMenuOpen(false)}>خدماتنا</Link></li>
        <li><Link to="/contact" onClick={() => setIsMenuOpen(false)}>تواصل معنا</Link></li>
        <li><Link to="/contact" className="consult-btn" onClick={() => setIsMenuOpen(false)}>اطلب استشارة فورية</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
